import React from 'react';
import {ExperiencePage} from './app/com'
import {HobbiesPage} from './app/components/pages/HobbiesPage'
import {MiniProjectPage} from './app/components/pages/MiniProjectPage'
import 'src/styles/App.css';

function App() {
  return (
    <div className="App">
     <ExperiencePage/>
     <HobbiesPage/>
     <MiniProjectPage/>
    </div>
  );
}

export default App;
